import React from "react";
import "./Service.css";

const Service = () => {
  return (
    <div>
      <div>
        <h2>Satisfaction Guaranteed</h2>
      </div>
      <div>
        <h2>Buy with confidence</h2>
      </div>
      <div>
        <h2>At your service</h2>
      </div>
    </div>
  );
};

export default Service;
